import React from "react";

import { LogoContainer, Tilt } from "./logo.styles";
const Logo = () => {
  return (
    <>
      <LogoContainer>
        <TiltContainer>
          <div className="Tilt-inner">KEK</div>
        </TiltContainer>
      </LogoContainer>
    </>
  );
};
export default Logo;
